import React from "react";
import  useEffect  from "react";
import "./App.css";


const getCliente = () => {
  console.log("hoola rick")
}


useEffect(()=>{
  getCliente()
},[]);
function App(){



  return(
    <div className="App">
      <h1> Hello, World! </h1>
      <button href="#" onClick={getCliente}>Clickeame</button>
    </div>
  );
}

export default App;
